import React, { Component } from "react";

class Table extends Component {
  state = {};
  render() {
    const { activities } = this.props;
    console.log(activities);
    return (
      <table>
        <thead>
          <tr></tr>
        </thead>
        <tbody>
          {activities.forEach((element) => {
            <tr>
              {Object.values(element).forEach((value) => {
                return <td>{value}</td>;
              })}
            </tr>;
          })}
        </tbody>
      </table>
    );
  }
}

export default Table;
